Description. Adult (
Figs 19–22
). Colouration. Male: [specimens in ethanol] Brown with dark brown to black markings: vertex dark brown with a pale submedial suffused marking between medial suture and fovea; eyes reddish brown; antennal segments 1–2 with brown infuscation, 8–10 progressively dark brown to black; genal processes dark brown to black; pronotum with pale medial suffusion; mesopraescutum with a pair of broad brown to dark brown submedial markings; mesoscutum with a medial and two pairs of dark brown to dark brown submedial markings; mesoscutellum brown to dark brown; fore and hind wings clear; fore wing veins R+M+Cu, R and R 1 pigmented slightly darker brown than other wing veins; legs yellow-brown with brown to dark brown infuscation on dorsal femora and tibia; abdominal tergites 1–5 dark brown to black; sternites pale yellow brown with medial brown infuscation; abdominal membrane colouration pale; proctiger dark brown paler dorsolaterally; subgenital plate dark brown with pale anteriomedially; parameres yellow brown basally, with extensive brown infuscation posteriorly and apices black. Female: [specimens in ethanol] considerably paler than male, yellow brown; vertex with brown subapical band and small brown marking in vicinity of fovea; pronotum pale yellow brown, paler medially; mesopraescutum very pale with a thin medial stripe and a pair of light orange brown submedial markings; mesoscutum very pale with an indistinct orange brown medial stripe and a pair of orange brown submedial markings; mesoscutellum pale yellow brown; abdominal tergites 1–5 brown, with segments 2–4 each with a well-defined very pale yellow brown, almost white, submedial marking; sternites pale yellow brown with brown medial infuscation; proctiger brown, paler on posterior margin; subgenital plate pale yellow brown with orange brown apex.

Structure. Measurements as in
Tables 4–8
. Body large, compact (
Figs 19–22
). Head (
Figs 23–24
); vertex with prominent medial suture, moderately sunk in vicinity of fovea; genal processes moderate in length, 0.48–0.56 times as long as vertex; antenna short, 0.79–0.86 times width of head, with two subapical rhinaria on each of segments 3 and 4, 1– 2 on segment 6 and a single rhinarium on each of segments 8 and 9 ; segment 10 with a short bluntly rounded seta and a minute bluntly rounded seta. Fore wing (
Figs 25–26
) 5.21–5.29 times as long as head width, 2.63–2.80 times as long as wide, short, broad with slightly pointed apex; vein Rs straight, slightly upturned distally, terminating short of wing apex, little shorter than vein M, RsM: 0.90–0.97 ; medial cell short, a little shorter than cubital cell; veins M 1 + 2 and M 3 + 4 short, broadly diverging with corresponding low m 1 cell value: 1.13–1.68 ; veins Cu 1 a long, weakly arched and Cu 1 b short, widely divergent with corresponding moderate cu 1 cell value: 1.84 –2.00; metatibia 0.96–1.03 times as long as width of head, considerably longer than metafemur, with 2 inner and 1 outer indistinct, barely sclerotised apical spurs. Male terminalia (
Figs 39–40
); proctiger conoid, short, with weakly expanded lateral lobes; subgenital plate broadly rounded; parameres (
Fig. 40
) short, broad, blade-like, evenly tapering to incurved sclerotised apices; distal portion of aedeagus moderate in length, with asymmetrical apical expansion (
Fig. 39
). Female terminalia (
Fig. 45
): proctiger short, triangular, posterior margin flat from lateral aspect and with strongly sclerotised sharply pointed apex; subgenital plate, triangular with tapering, strongly sclerotised sharply pointed apex; distal portion of proctiger with dense short pale setae and subapical dense brush of short dark sclerotised hooked setae; subgenital plate with very sparse short setae.
